import React, { useState } from 'react';
import {
  CountryDropdown,
  RegionDropdown,
} from 'react-country-region-selector';

import "react-country-region-selector/dist/index.css";

export default function CustomCountrySelect({ onChange }) {
  const [country, setCountry] = useState('');

  return (
    <div className="custom-country-select">
      <div className="select-with-icon">
        <i className="fa fa-globe"></i>
        <CountryDropdown
          value={country}
          onChange={(val) => {
            setCountry(val);
            onChange(val);
          }}
        />
      </div>
    </div>
  );
}
